import React from 'react';

const Dashboard = React.lazy(() => import('./views/Dashboard'));
const Clientes = React.lazy(() => import('./views/Clientes'));
const Tickets = React.lazy(() => import('./views/Tickets'));


// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: '/', exact: true, name: 'Home' },
  { path: '/dashboard', name: 'Dashboard', component: Dashboard },
  { path: '/clientes', name: 'Clientes', component: Clientes },
  { path: '/tickets', name: 'Tickets', component: Tickets },
  { path: '/usuarios', name: 'Usuarios', component: Dashboard },
  { path: '/tipos-suporte', name: 'Tipos Suporte', component: Dashboard },
  { path: '/tipos-status', name: 'Tipos Status', component: Dashboard },
];

export default routes;
